pragma solidity 0.8.22;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "./TokenTemplate_v2DirectDEX.sol";

// Custom errors
error InsufficientETH(uint256 required, uint256 provided);
error TokenNotFound(address token);
error TokenAlreadyListed(address token);
error NotTokenOwner(address token, address caller);
error InsufficientTokenAllowance(uint256 required, uint256 provided);
error InvalidTokenAmount(uint256 amount);
error InvalidETHAmount(uint256 amount);
error InvalidListingPrice(uint256 price);
error LiquidityAdditionFailed(address token, uint256 ethAmount, uint256 tokenAmount);
error PairCreationFailed(address token, address router);

contract TokenFactory_v2_DirectDEX_Fixed is Ownable, ReentrancyGuard {
    string public constant VERSION = "2.2.2"; // Updated version
    bytes32 public constant VERSION_HASH = keccak256(abi.encodePacked(VERSION));

    // Simplified DEX handling
    address public immutable defaultRouter;

    struct TokenCreationParams {
        string name;
        string symbol;
        uint256 totalSupply;
        uint256 maxTxAmount;
        uint256 maxWalletAmount;
        bool enableTrading;
        uint256 tradingStartTime;
        uint256 marketingFeePercentage;
        address marketingWallet;
        uint256 developmentFeePercentage;
        address developmentWallet;
        uint256 autoLiquidityFeePercentage;
        bool enableBuyFees;
        bool enableSellFees;
    }

    struct TokenInfo {
        address token;
        address owner;
        bool isListed;
        uint256 creationTime;
        uint256 listingTime;
    }

    // Token tracking
    mapping(address => TokenInfo) public tokenInfo;
    address[] public allTokens;
    uint256 public listingFee;

    // Events
    event TokenCreated(
        address indexed token,
        address indexed owner,
        string name,
        string symbol,
        uint256 totalSupply,
        uint256 creationTime
    );

    event TokenListed(
        address indexed token,
        address indexed owner,
        uint256 initialLiquidity,
        uint256 listingPrice,
        uint256 listingTime
    );

    constructor(uint256 _listingFee) {
        listingFee = _listingFee;

        // Set appropriate router based on chain ID
        if (block.chainid == 11155111) { // Sepolia
            // Use the correct Uniswap V2 Router for Sepolia
            defaultRouter = 0xeE567Fe1712Faf6149d80dA1E6934E354124CfE3; // Uniswap V2 Router on Sepolia
        } else if (block.chainid == 97) { // BSC Testnet
            defaultRouter = 0xD99D1c33F9fC3444f8101754aBC46c52416550D1; // PancakeSwap Router
        } else {
            defaultRouter = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D; // Default to Uniswap V2 Router
        }
    }

    // Step 1: Create Token
    function createToken(TokenCreationParams calldata params) external nonReentrant returns (address) {
        // Create token
        TokenTemplate_v2DirectDEX token = new TokenTemplate_v2DirectDEX(
            params.name,
            params.symbol,
            params.totalSupply,
            params.maxTxAmount,
            params.maxWalletAmount,
            params.enableTrading,
            params.tradingStartTime,
            address(0), // Router will be set during listing
            params.marketingFeePercentage,
            params.developmentFeePercentage,
            params.autoLiquidityFeePercentage,
            params.marketingWallet,
            params.developmentWallet,
            address(this),
            params.enableBuyFees,
            params.enableSellFees
        );

        // Store token info
        tokenInfo[address(token)] = TokenInfo({
            token: address(token),
            owner: msg.sender,
            isListed: false,
            creationTime: block.timestamp,
            listingTime: 0
        });

        allTokens.push(address(token));

        // Transfer ownership to creator
        token.transferOwnership(msg.sender);

        emit TokenCreated(
            address(token),
            msg.sender,
            params.name,
            params.symbol,
            params.totalSupply,
            block.timestamp
        );

        return address(token);
    }

    // Step 2: List Token on DEX
    function listTokenOnDEX(
        address tokenAddress,
        uint256 initialLiquidityInETH,
        uint256 listingPriceInETH,
        uint256 liquidityPercentage
    ) external payable nonReentrant returns (bool) {
        // Validate token
        TokenInfo storage info = tokenInfo[tokenAddress];
        if (info.token == address(0)) revert TokenNotFound(tokenAddress);
        if (info.isListed) revert TokenAlreadyListed(tokenAddress);
        if (info.owner != msg.sender) revert NotTokenOwner(tokenAddress, msg.sender);

        // Store sent ETH value for potential refund
        uint256 sentValue = msg.value;

        // Validate ETH amount
        if (sentValue < initialLiquidityInETH + listingFee) {
            revert InsufficientETH(initialLiquidityInETH + listingFee, sentValue);
        }

        // Validate liquidity percentage
        require(liquidityPercentage >= 1 && liquidityPercentage <= 100, "Invalid liquidity percentage");

        // Get token and router
        TokenTemplate_v2DirectDEX token = TokenTemplate_v2DirectDEX(tokenAddress);
        IUniswapV2Router02 router = IUniswapV2Router02(defaultRouter);

        // Calculate tokens needed for liquidity
        uint256 tokensForLiquidity = (token.totalSupply() * liquidityPercentage) / 100;

        // Check token balance first
        uint256 tokenBalance = IERC20(tokenAddress).balanceOf(msg.sender);
        if (tokenBalance < tokensForLiquidity) {
            revert InsufficientTokenAllowance(tokensForLiquidity, tokenBalance);
        }

        // Check router allowance directly
        uint256 routerAllowance = token.allowance(msg.sender, address(router));
        if (routerAllowance < tokensForLiquidity) {
            revert InsufficientTokenAllowance(tokensForLiquidity, routerAllowance);
        }

        // Create pair first
        address uniswapFactory = router.factory();
        address pair;
        try IUniswapV2Factory(uniswapFactory).createPair(
            tokenAddress,
            router.WETH()
        ) returns (address _pair) {
            pair = _pair;
        } catch {
            revert PairCreationFailed(tokenAddress, address(router));
        }

        if (pair == address(0)) {
            revert PairCreationFailed(tokenAddress, address(router));
        }

        // Set router and pair in token contract
        token.setRouter(address(router));
        token.setPair(pair);

        // Calculate minimum amounts with 2% slippage tolerance
        uint256 minTokens = tokensForLiquidity * 98 / 100;
        uint256 minETH = initialLiquidityInETH * 98 / 100;

        // Add liquidity directly through router
        try router.addLiquidityETH{value: initialLiquidityInETH}(
            tokenAddress,
            tokensForLiquidity,
            minTokens,
            minETH,
            msg.sender,
            block.timestamp + 300
        ) {
            // Update token info only after successful liquidity addition
            info.isListed = true;
            info.listingTime = block.timestamp;

            emit TokenListed(
                tokenAddress,
                msg.sender,
                initialLiquidityInETH,
                listingPriceInETH,
                block.timestamp
            );

            // Keep listing fee, refund excess ETH if any
            uint256 excess = sentValue - (initialLiquidityInETH + listingFee);
            if (excess > 0) {
                (bool success, ) = msg.sender.call{value: excess}("");
                require(success, "ETH refund failed");
            }

            return true;
        } catch {
            // Refund everything except listing fee on failure
            uint256 refundAmount = sentValue - listingFee;
            (bool success, ) = msg.sender.call{value: refundAmount}("");
            require(success, "Failed to refund ETH");

            // Revert with detailed error
            revert LiquidityAdditionFailed(tokenAddress, initialLiquidityInETH, tokensForLiquidity);
        }
    }

    // Emergency refund function
    function emergencyRefund(address tokenAddress) external nonReentrant {
        TokenInfo storage info = tokenInfo[tokenAddress];
        require(info.token == tokenAddress, "Token not found");
        require(info.owner == msg.sender, "Not token owner");
        require(!info.isListed, "Token already listed");

        // Calculate refundable amount (everything except listing fee)
        uint256 refundAmount = address(this).balance - listingFee;
        require(refundAmount > 0, "No refund available");

        // Send refund
        (bool success, ) = msg.sender.call{value: refundAmount}("");
        require(success, "Refund failed");
    }

    // View functions
    function getListingFee() external view returns (uint256) {
        return listingFee;
    }

    function isListed(address token) external view returns (bool) {
        return tokenInfo[token].isListed;
    }

    function getTokenInfo(address token) external view returns (TokenInfo memory) {
        return tokenInfo[token];
    }

    function getAllTokens() external view returns (address[] memory) {
        return allTokens;
    }

    // Admin functions
    function setListingFee(uint256 _newFee) external onlyOwner {
        listingFee = _newFee;
    }

    function withdrawFees() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
} ","keccak256":"0x1e147093a2f6baa0064fa9cd3382cd3582d22107fe6a36a8fe682d416d49723b","license":"MIT"},"src/contracts/TokenTemplate_v2DirectDEX.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Address.sol";

interface ITokenFactory {
    function _accumulateAutoLiquidity(address token, uint256 amount) external;
}

contract TokenTemplate_v2DirectDEX is ERC20, Ownable, ReentrancyGuard {
    using Address for address;

    // Token Info
    uint256 public constant VERSION = 2;
    bytes32 public constant VERSION_HASH = keccak256("TOKEN_TEMPLATE_V2_DIRECTDEX");

    // Trading Settings
    bool public tradingEnabled;
    uint256 public tradingStartTime;
    uint256 public maxTxAmount;
    uint256 public maxWalletAmount;

    // DEX Settings
    address public dexRouter;
    address public dexPair;

    // Fee Settings
    uint256 public marketingFeePercentage;
    uint256 public developmentFeePercentage;
    uint256 public autoLiquidityFeePercentage;
    address public marketingWallet;
    address public developmentWallet;
    address public autoLiquidityWallet;
    bool public enableBuyFees;
    bool public enableSellFees;

    // Auto-Liquidity Settings
    uint256 public constant MIN_TOKENS_FOR_LIQUIDITY = 1000; // Minimum tokens needed for auto-liquidity
    mapping(address => bool) public isExcludedFromAutoLiquidity;

    // Blacklist
    mapping(address => bool) public isBlacklisted;

    // Events
    event TradingEnabled(uint256 timestamp);
    event MaxTxAmountUpdated(uint256 amount);
    event MaxWalletAmountUpdated(uint256 amount);
    event BlacklistUpdated(address account, bool isBlacklisted);
    event TaxesUpdated(uint256 totalFees);
    event WalletsUpdated(address marketing, address development, address autoLiquidity);

    constructor(
        string memory name_,
        string memory symbol_,
        uint256 totalSupply_,
        uint256 maxTxAmount_,
        uint256 maxWalletAmount_,
        bool enableTrading_,
        uint256 tradingStartTime_,
        address dexRouter_,
        uint256 marketingFeePercentage_,
        uint256 developmentFeePercentage_,
        uint256 autoLiquidityFeePercentage_,
        address marketingWallet_,
        address developmentWallet_,
        address autoLiquidityWallet_,
        bool enableBuyFees_,
        bool enableSellFees_
    ) ERC20(name_, symbol_) Ownable() {
        require(totalSupply_ > 0, "Total supply must be greater than 0");
        require(maxTxAmount_ <= totalSupply_, "Max transaction amount cannot exceed total supply");
        require(maxWalletAmount_ <= totalSupply_, "Max wallet amount cannot exceed total supply");
        require(marketingFeePercentage_ + developmentFeePercentage_ + autoLiquidityFeePercentage_ <= 25, "Total fees cannot exceed 25%");
        require(marketingWallet_ != address(0), "Marketing wallet cannot be zero address");
        require(developmentWallet_ != address(0), "Development wallet cannot be zero address");
        require(autoLiquidityWallet_ != address(0), "Auto-liquidity wallet cannot be zero address");

        // Set up the token parameters first
        maxTxAmount = maxTxAmount_;
        maxWalletAmount = maxWalletAmount_;
        tradingEnabled = enableTrading_;
        tradingStartTime = tradingStartTime_;
        dexRouter = dexRouter_;

        marketingFeePercentage = marketingFeePercentage_;
        developmentFeePercentage = developmentFeePercentage_;
        autoLiquidityFeePercentage = autoLiquidityFeePercentage_;

        marketingWallet = marketingWallet_;
        developmentWallet = developmentWallet_;
        autoLiquidityWallet = autoLiquidityWallet_;

        enableBuyFees = enableBuyFees_;
        enableSellFees = enableSellFees_;

        // Exclude critical addresses from fees and limits
        isExcludedFromAutoLiquidity[msg.sender] = true;
        isExcludedFromAutoLiquidity[address(this)] = true;
        isExcludedFromAutoLiquidity[marketingWallet_] = true;
        isExcludedFromAutoLiquidity[developmentWallet_] = true;
        isExcludedFromAutoLiquidity[autoLiquidityWallet_] = true;
        isExcludedFromAutoLiquidity[dexRouter_] = true;  // Exclude DEX router

        // Calculate liquidity amount
        uint256 tokensForLiquidity = (totalSupply_ * 20) / 100; // 20% for liquidity
        uint256 remainingTokens = totalSupply_ - tokensForLiquidity;

        // First mint tokens to the factory for liquidity
        _mint(autoLiquidityWallet_, tokensForLiquidity);

        // Then mint remaining tokens to the deployer
        _mint(msg.sender, remainingTokens);

        // Set up allowances
        _approve(autoLiquidityWallet_, dexRouter_, type(uint256).max);

        _transferOwnership(msg.sender);
    }

    // Trading Control Functions
    function enableTrading() external onlyOwner {
        require(!tradingEnabled, "Trading already enabled");
        tradingEnabled = true;
        if (tradingStartTime == 0) {
            tradingStartTime = block.timestamp;
        }
        emit TradingEnabled(tradingStartTime);
    }

    function setMaxTxAmount(uint256 amount) external onlyOwner {
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= totalSupply(), "Amount cannot exceed total supply");
        maxTxAmount = amount;
        emit MaxTxAmountUpdated(amount);
    }

    function setMaxWalletAmount(uint256 amount) external onlyOwner {
        require(amount > 0, "Amount must be greater than 0");
        require(amount <= totalSupply(), "Amount cannot exceed total supply");
        maxWalletAmount = amount;
        emit MaxWalletAmountUpdated(amount);
    }

    // Blacklist Functions
    function setBlacklist(address account, bool blacklisted) external onlyOwner {
        require(account != address(0), "Invalid address");
        isBlacklisted[account] = blacklisted;
        emit BlacklistUpdated(account, blacklisted);
    }

    // Tax Functions
    function setTaxes(
        uint256 marketingFee,
        uint256 developmentFee,
        uint256 autoLiquidityFee
    ) external onlyOwner {
        require(marketingFee + developmentFee + autoLiquidityFee <= 25, "Total fees cannot exceed 25%");
        marketingFeePercentage = marketingFee;
        developmentFeePercentage = developmentFee;
        autoLiquidityFeePercentage = autoLiquidityFee;
        emit TaxesUpdated(marketingFee + developmentFee + autoLiquidityFee);
    }

    function setWallets(
        address marketing,
        address development,
        address autoLiquidity
    ) external onlyOwner {
        require(marketing != address(0) && development != address(0) && autoLiquidity != address(0), "Invalid address");
        marketingWallet = marketing;
        developmentWallet = development;
        autoLiquidityWallet = autoLiquidity;
        emit WalletsUpdated(marketing, development, autoLiquidity);
    }

    // Internal Functions
    function _excludeFromLimits(address account) internal {
        // Implementation for excluding addresses from transaction and wallet limits
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        require(!isBlacklisted[from] && !isBlacklisted[to], "Blacklisted address");

        // Skip trading checks and fees for excluded addresses or initial setup
        if (isExcludedFromAutoLiquidity[from] || isExcludedFromAutoLiquidity[to] || 
            (from == owner() && to == autoLiquidityWallet)) {
            super._transfer(from, to, amount);
            return;
        }

        require(tradingEnabled || from == owner() || to == owner(), "Trading not enabled");
        if (tradingStartTime > 0) {
            require(block.timestamp >= tradingStartTime, "Trading not started");
        }

        if (maxTxAmount > 0) {
            require(amount <= maxTxAmount, "Exceeds max transaction amount");
        }

        if (maxWalletAmount > 0 && !isExcludedFromAutoLiquidity[to]) {
            require(balanceOf(to) + amount <= maxWalletAmount, "Exceeds max wallet amount");
        }

        uint256 totalTaxAmount = 0;

        if (to == dexPair || from == dexPair) { // Buy or Sell
            bool isBuy = from == dexPair;
            bool shouldApplyFees = (isBuy && enableBuyFees) || (!isBuy && enableSellFees);

            if (shouldApplyFees) {
                uint256 marketingAmount = (amount * marketingFeePercentage) / 100;
                uint256 developmentAmount = (amount * developmentFeePercentage) / 100;
                uint256 autoLiquidityAmount = (amount * autoLiquidityFeePercentage) / 100;

                totalTaxAmount = marketingAmount + developmentAmount + autoLiquidityAmount;

                if (totalTaxAmount > 0) {
                    // Check if sender has enough balance for transfer + fees
                    require(balanceOf(from) >= amount, "Insufficient balance for transfer");

                    // First transfer the main amount
